import React from "react";

function LoginPage() {
    return (
        <div style={styles.page}>
            <h1>Login</h1>
            <p>Connectez-vous pour accéder à vos données et gérer vos informations personnelles.</p>
        </div>
    );
}

const styles = {
    page: {
        textAlign: "center",
        padding: "50px",
    },
};

export default LoginPage;
